var district, food, info
var element = document.getElementById("data-result")

function getValue() {
    var searchValue = document.getElementById("search").value
    for (var i = 0; i < dataSource.length; i++) {
        console.log(i)
        dataSource[i].food.map(item => {
            if (searchValue === item.id.toLowerCase()) {
                const resultSearch = item.info.map(info => {
                    console.log(info.name, info.address)
                    const html = `
                    <div class="">
                        <div class="card">
                            <img class="pic"
                                src="${info.link}"
                                alt=" Denim Jeans" style="width:100%">
                            <h1> ${info.name}</h1>
                            <p class="price"><3</p>
                            <p>Delicious!</p>
                            <p id="Fucking"><button>${info.address}</button></p>
                        </div>
                    </div>
                    `
                    element.insertAdjacentHTML("beforeend", html)
                })
            }
            return item
        })
    }


}

